    //TS & HTML variable -----------------------------------------------------------
    public dataSource: MatTableDataSource<RetailMonthModel> = new MatTableDataSource<RetailMonthModel>();
    public year: number = 2020;
    public month: number = 10;
    public percent: RetailPercentModel;
    //Only TS Variable ------------------------------------------------------------
    private _linkOutput: LinkModel = new LinkModel();
    //ViewChild & Input & Output -------------------------------------------------
    @ViewChild(MatAccordion, { static: false }) accordion: MatAccordion;
    @ViewChild(MatPaginator, { static: true }) paginator: MatPaginator;
    @ViewChild('TABLE', { static: false }) table: ElementRef;

    exportExcel() {
        const ws: XLSX.WorkSheet = XLSX.utils.table_to_sheet(this.table.nativeElement);
        const wb: XLSX.WorkBook = XLSX.utils.book_new();
        XLSX.utils.book_append_sheet(wb, ws, 'Tổng mức bán lẻ hàng hóa');

        XLSX.writeFile(wb, 'Tổng mức bán lẻ hàng hóa.xlsx');

    }

    //Contructor + Init + Destroy
    constructor(
        private _breadCrumService: BreadCrumService,
        private _route: ActivatedRoute
    ) {
        this._route.queryParams.subscribe(params => {
            this.year = params["year"];
            this.month = params["month"];
        });
        console.log(this._route.params);
    }

    ngOnInit() {
        this.initData();
        this.sendLinkToNext(true);
    }
    //HTML & TS Function ----------------------------------------------------------

    //TS Function -----------------------------------------------------------------
    private initData(): void {

        this.dataSource = new MatTableDataSource(this.getDataByMonth(this.month, this.year));

        this.dataSource.paginator = this.paginator;
        this.paginator._intl.itemsPerPageLabel = 'Số hàng';
        this.paginator._intl.firstPageLabel = "Trang Đầu";
        this.paginator._intl.lastPageLabel = "Trang Cuối";
        this.paginator._intl.previousPageLabel = "Trang Trước";
        this.paginator._intl.nextPageLabel = "Trang Tiếp";
    }
    private sendLinkToNext(type: boolean): void {
        this._linkOutput.link = this.LINK_DEFAULT + "yaer=" + this.year + "&month=" + this.month;
        this._linkOutput.title = this.TITLE_DEFAULT + this.month + "/" + this.year;
        this._linkOutput.text = this.TEXT_DEFAULT + this.month + "/" + this.year;
        this._linkOutput.type = type;
        this._breadCrumService.sendLink(this._linkOutput);
    }

    private getDataByMonth(month: number, year: number) {
        let data: Array<RetailMonthModel> = [];
        console.log("year:", year, " and month: ", month);
        if (year != 2020 || month > 12) {
            return [];
        }
        else {
            data = this.DATA_DEFAULT[month - 1];
            this.percent = this.DATA_KEHOACH[month - 1][0];
            if (month == 1) return data;
            else {
                let previousData = this.DATA_DEFAULT[month - 2];
                data.forEach(ele => {
                    ele.thuc_hien_thang_truoc = previousData.find(e => e.chi_tieu == ele.chi_tieu).thuc_hien_thang;
                    ele.thuc_hien_so_voi_thang_truoc = ele.thuc_hien_thang / ele.thuc_hien_thang_truoc * 100;
                })
            }
            return data;

        }
    }
